@citlali_tamales was one of the first people I met in the hi-des, so it felt serendipitous we got to collaborate with @all_roads_studio on this dreamy desert project. I know I say this often, but her food is my favorite out here! If you get a chance to visit one of her pop-ups, it’s not to be missed!

She’s pictured here wearing the new aprons from @all_roads_studio’s Fall textile line, photographed at @lolos_casita. 

Thank you to @lolopaezburt, @janelle_pietrzak & @tayloraskins. 🧡

Who remembers when I would make anyone I photographed also JUMP for my camera? I said earlier this year, maybe I should bring that back?

@onedowndog opened up a beautiful new yoga studio space in Hollywood - which felt like an appropriate reason to get in the air!

#jumpology
